using namespace std;

//function declarations
void printStationName(string stations[238],int[],string[]);
void printPath(int[],int,string[],int);
void printSolution(int distance[],int parent[],int,int,string[]);
int mindistance(int[],bool[]);
void dijkstra(int[][238],string[],int,int);

//function definitions
void printStationName(string stations[238],int n[],string LineName[])
{
    int i,j,k;
    for(i=0,j=0;i<=8;i++)
    {
        cout<<endl<<"|--------------------"<<LineName[i]<<"--------------------|"<<endl<<endl;
        {
            for(int k=0;k<n[i];k++,j++)
                cout<<"Enter "<<j<<" for "<<stations[j]<<endl;
        }
    }
}
void printPath(int parent[],int j,string stations[],int destination) //printing route
{
    if(parent[j]==-1) // condition for source
        return;
    printPath(parent,parent[j],stations,destination);  //recursively calling print path for finding parent for printing route

    if(j!=destination)
        cout<<stations[j]<<" -> ";          //printing route
    else
        cout<<stations[j]<<endl;
}
void printSolution(int distance[],int parent[],int source,int destination,string stations[]) //finding route
{
    cout<<endl<<"|  SOURCE -> DESTINATION  |  DISTANCE  |"; //info
    for(int i=0;i<238;i++)
    {
        if(i==destination)
        {
            cout<<endl<<"|  "<<stations[source]<<" -> "<<stations[i]<<"  |  "<<distance[i]<<" st.  |"<<endl<<endl;
            cout<<"SHORTEST ROUTE : "<<endl<<endl;
            cout<<stations[source]<<" -> "; //printing first station
            printPath(parent,i,stations,destination); //printing route
        }
    }
}
int mindistance(int distance[],bool status[]) //minimum distance
{
    int minimum=INT_MAX,index;
    for (int k=0;k<238;k++)
    {
        if(status[k]==false && distance[k]<=minimum)
        {
            minimum=distance[k];
            index=k;
        }
    }
    return index;
}
void dijkstra(int graph[][238],string stations[],int source,int destination) //shortest path
{
    int distance[238]; //stores distance from source
    bool status[238]; //stores whether station is consisidered or not
    int parent[238]; //collect info. of parent station of all stations 
    for(int i=0;i<=237;i++)
    {
        distance[i]=INT_MAX;
        status[i]=false;
        parent[i]=-1;
    }

    //distance from source to source 
    distance[source]=0;

    for(int j=0;j<=237;j++)
    {
        int s=mindistance(distance,status); //finding minimum distance between current distance array
        status[s]=true;

        for(int d=0;d<=237;d++)
        {
            if(!status[d] && graph[s][d] && distance[s]!=INT_MAX && distance[d] > distance[s]+graph[s][d])
            {
                distance[d]=distance[s]+graph[s][d];
                parent[d]=s;
            }
        }
        //now we got the distance for source to all stations and their parent stations
    }

    int choice;
    while(1)
    {
        cout<<endl<<"|----------------------Home Page----------------------|"<<endl;
        cout<<"1. Minimum Number of stations from "<<stations[source]<<" to all stations."<<endl;
        cout<<"2. Charges and Path from "<<stations[source]<<" to "<<stations[destination]<<"."<<endl;
        cout<<"3. Exit"<<endl<<endl;
        cout<<"Please Enter your choice : ";
        cin>>choice;
        cout<<endl;

        switch(choice)
        {
            case 1: //for printing minimum distance between source to all station
                cout<<endl<<"Minimum Number of stations from "<<stations[source]<<" to every station is \n"<<endl;
                for(int k=0;k<=237;k++)
                {
                    cout<<"Minimum stations from "<<stations[source]<<" to "<<stations[k]<<" are "<<distance[k]<<endl;
                }
                break;
            case 2: //for calculation of fair and finding route
                {
                    int x=abs(distance[source]-distance[destination]);
                    if(x==0)
                        cout<<"Fair : Rs 0.0";
                    else if(x<=1)
                        cout<<"Fair : Rs 10.0";
                    else if(x<=4)
                        cout<<"Fair : Rs 20.0";
                    else if(x<=10)
                        cout<<"Fair : Rs 30.0";
                    else if(x<=18)
                        cout<<"Fair : Rs 40.0";
                    else if(x<=29)
                        cout<<"Fair : Rs 50.0";
                    else 
                        cout<<"Fair : Rs 60.0";

                    //finding route
                    printSolution(distance,parent,source,destination,stations);
                }
                break;
            case 3:
                cout<<"You are exitted";
                exit(0);
        }
    }
}
